import ResetIcon from './assets/ic-reset.svg';

function Button({ children, onClick }) {
  return (
    <button
      className="App-reset"
      onClick={onClick}
      src={ResetIcon}
      alt="초기화"
    >
      {children}
    </button>
  );
}

export default Button;
